  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Union Slough
  NWR outlines Refuge accomplishments from May through August of 1951. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  raptors, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. Resource management is outlined;
  topics include grazing and haying. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, fishing, and violations.
  N-R forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
